import React from "react";
import { CartProps } from "../../props";
import {
  NoStyleDiv,
  Span,
  OrderButton,
  Bold,
  OrderText,
} from "../../styles/cart";
class Order extends React.Component<CartProps> {
  render() {
    return (
      <div>
        <Span>
          Tax 21%: <Bold>{this.props.currency}15.00</Bold>
        </Span>
        <Span>
          Qauntity: <Bold>{this.props.totalQuantity}</Bold>
        </Span>
        <NoStyleDiv>
          <Span>
            Total:{" "}
            <Bold>
              {this.props.currency}
              {this.props.totalAmount}
            </Bold>
          </Span>
        </NoStyleDiv>
        <OrderButton>
          <OrderText>ORDER</OrderText>
        </OrderButton>
      </div>
    );
  }
}

export default Order;
